import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Set mobile viewport to trigger mobile menu
    await page.setViewportSize({ width: 375, height: 667 });

    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click mobile menu button (using class selector)
    await page.waitForSelector('.nav-menu', { timeout: 5000 });
    await page.click('.nav-menu');

    // Wait for mobile menu to appear and take screenshot
    await page.waitForSelector('#mobileMenuOverlay.show', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_menu_open.png'));

    // Extract menu items for verification
    const menuItems = await page.$$eval('#mobileMenuOverlay a', 
      items => items.map(item => item.textContent.trim())
    );

    // Click on a menu item (Electronics)
    await page.waitForSelector('#mobileMenuOverlay a', { timeout: 5000 });
    await page.click('#mobileMenuOverlay a');

    // Wait for navigation and take final screenshot
    await page.waitForTimeout(1000); // Brief pause for any UI updates
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_menu_navigation.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_menu_navigation.png'));

    return {
      success: true,
      action: "Tested mobile menu navigation by opening menu and selecting Electronics",
      extractedData: {
        menuItems: menuItems,
        selectedItem: "Electronics"
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete mobile menu navigation test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
